import styled from 'styled-components';

const Navbar = styled.nav`
  position: sticky;
  top: 0;
  left: 0;
  right: 0;
  min-height: 50px;
  background: var(--bg);
`;

function App() {
  return (
  <>
    <Navbar>
      <div className="container"></div>
    </Navbar>
    <div>검색창</div>
  </>
  );
}

export default App;
